import Link from "next/link";
import Head from "next/head";

import styled from "styled-components";
import Post from "./posts/post";

function App() {
  return (
    <div>
      <Head>
        <title>First Post</title>
      </Head>
      <Link href="/posts/post">
        <a>this page!</a>
      </Link>
    </div>
  );
}

const Title = styled.h1`
  color: #333;
`;

export default App;
